trailingComments.value:
.reduce((result, ref) => {
              const id = new NodeId(ref.nodeId.toString());

              if (ref.nodeClass.value === 2) {
              result.variables.push(id);
              } else {
              result.objects.push(id);
              }

              return result;
              }, { variables: [], objects: [] })

